script: |
  super -f text -I q11155.spq | sort > q11155.out

inputs:
  - name: q11155.spq
    data: |
      SELECT DISTINCT - - cor1.col1 / cor1.col1 + 38 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q11155.out
    data: |
      39
